lockfileVersion: '9.0'

settings:
  autoInstallPeers: true
  excludeLinksFromLockfile: false

importers:

  .:
    dependencies:
      '@cprussin/option-result':
        specifier: file:../../../dist
        version: file:../../../dist

packages:

  '@cprussin/option-result@file:../../../dist':
    resolution: {directory: ../../../dist, type: directory}

snapshots:

  '@cprussin/option-result@file:../../../dist': {}
